CREATE DEFINER=`root`@`localhost` PROCEDURE `spRelatorioAnotacoes`(var_session_id INT)
BEGIN 

	/* VARIÁVEIS */
	
    DECLARE maxEstadosAfetivos INT;
    DECLARE maxComportamentos INT; 
    DECLARE maxCoders INT; 
    DECLARE id_coder INT;
    DECLARE nome_coder VARCHAR(20);
    DECLARE nome_coluna VARCHAR(20);
	DECLARE i_loop_coder INT;
    DECLARE i_loop_afebeh INT;
    DECLARE str_query VARCHAR(100);
    DECLARE var_time_on_video_session TIME;
    DECLARE old_time TIME;
    DECLARE old_session_id INT;
    DECLARE old_coder_id INT;
    DECLARE i_afebeh INT;
    DECLARE var_last_id INT;
    DECLARE cursorFinalizado INT DEFAULT FALSE;
    DECLARE cursorCoders CURSOR FOR SELECT DISTINCT c.coder_id, co.nome FROM clip c INNER JOIN coder co ON c.coder_id = co.id WHERE c.session_id = var_session_id GROUP BY c.coder_id, co.nome;
    DECLARE cursorClips CURSOR FOR SELECT DISTINCT time_on_video_session FROM clip WHERE session_id = var_session_id;
    DECLARE cursorAffectives CURSOR FOR SELECT c.time_on_video_session, co.id, co.nome, label FROM clip c INNER JOIN clip_emotion_label cel ON c.id = cel.clip_id INNER JOIN emotion_label el ON cel.emotion_label_id = el.id INNER JOIN coder co ON c.coder_id = co.id WHERE c.session_id = var_session_id ORDER BY time_on_video_session, co.id, cel.id;
    DECLARE cursorBehaviors CURSOR FOR SELECT c.time_on_video_session, co.id, co.nome, label FROM clip c INNER JOIN clip_behavior_label cbl ON c.id = cbl.clip_id INNER JOIN behavior_label bl ON cbl.behavior_label_id = bl.id INNER JOIN coder co ON c.coder_id = co.id WHERE c.session_id = var_session_id ORDER BY time_on_video_session, co.id, cbl.id;
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET cursorFinalizado = TRUE;
    
    /* OBTÉM DADOS INICIAIS */
    
	SELECT MAX(quantidade) INTO maxEstadosAfetivos FROM(
		SELECT COUNT(*) AS quantidade
		FROM clip c INNER JOIN clip_emotion_label ce ON c.id = ce.clip_id
		WHERE c.session_id = var_session_id
		GROUP BY c.id
	) AS quantidade_por_estadoafetivo;
    
    SELECT MAX(quantidade) INTO maxComportamentos FROM (
		SELECT COUNT(*) AS quantidade
		FROM clip c INNER JOIN clip_behavior_label cb ON c.id = cb.clip_id
		WHERE c.session_id = var_session_id
		GROUP BY c.id
	) as quantidade_por_behavior;
    
    SELECT MAX(quantidade) INTO maxCoders FROM (
		SELECT COUNT(*) AS quantidade
		FROM record_session rs INNER JOIN study s ON rs.study_id = s.id
			 INNER JOIN coder co ON s.id = co.study_id
		WHERE rs.id = var_session_id
		GROUP BY rs.id
	) quantidade_por_coder;
    
    /* MONTA TABELA TEMPORÁRIA COM O RELATÓRIO */
    
    DROP TABLE IF EXISTS RelatorioAnotacoes;
    CREATE TEMPORARY TABLE IF NOT EXISTS RelatorioAnotacoes (id INT primary key AUTO_INCREMENT, session_id INT, time_on_video_session TIME);
    DELETE FROM RelatorioAnotacoes WHERE id >= 0;
    
    SET i_loop_coder = 0;
    loop_coder: LOOP
		
        IF i_loop_coder >= maxCoders THEN
			LEAVE loop_coder;
		END IF;
        
        SET i_loop_coder = i_loop_coder + 1;
		
        SET @nome_coluna = CONCAT('coder_', i_loop_coder);
	
		SET @str_query = CONCAT('ALTER TABLE RelatorioAnotacoes ADD COLUMN ', @nome_coluna, ' VARCHAR(45)');
		PREPARE stmt FROM @str_query;
        EXECUTE stmt;
        
        SET i_loop_afebeh = 0;
        loop_afetivo: LOOP
		
			IF i_loop_afebeh >= maxEstadosAfetivos THEN
				LEAVE loop_afetivo;
			END IF;
			
			SET i_loop_afebeh = i_loop_afebeh + 1;
			
			SET @nome_coluna = CONCAT('afe_', i_loop_coder, '_', i_loop_afebeh);
		
			SET @str_query = CONCAT('ALTER TABLE RelatorioAnotacoes ADD COLUMN ', @nome_coluna, ' VARCHAR(45)');
			PREPARE stmt FROM @str_query;
			EXECUTE stmt;
		
		END LOOP loop_afetivo;
        
        SET i_loop_afebeh = 0;
        loop_comportamento: LOOP
		
			IF i_loop_afebeh >= maxComportamentos THEN
				LEAVE loop_comportamento;
			END IF;
			
			SET i_loop_afebeh = i_loop_afebeh + 1;
			
			SET @nome_coluna = CONCAT('com_', i_loop_coder, '_', i_loop_afebeh);
		
			SET @str_query = CONCAT('ALTER TABLE RelatorioAnotacoes ADD COLUMN ', @nome_coluna, ' VARCHAR(45)');
			PREPARE stmt FROM @str_query;
			EXECUTE stmt;
		
		END LOOP loop_comportamento;
		
    END LOOP loop_coder;
    
    /* PREENCHE TABELA TEMPORARIA COM DADOS */
    
    OPEN cursorClips;
    
    SET old_time = null;
    
    loop_clips: LOOP
    
        FETCH cursorClips INTO var_time_on_video_session;
        
		IF cursorFinalizado THEN
            LEAVE loop_clips;
		ELSE
            
            INSERT INTO RelatorioAnotacoes (session_id, time_on_video_session) VALUES (var_session_id, var_time_on_video_session);
            SELECT LAST_INSERT_ID() INTO var_last_id;
            SET old_time = var_time_on_video_session;
			
            affectivesBlock: BEGIN
				
                DECLARE var_time_on_video_session_affective TIME;
				DECLARE var_coder_id_affective INT;
				DECLARE var_coder_name_affective VARCHAR(45);
				DECLARE var_label_affective VARCHAR(45);
                DECLARE cursorFinalizado2 INT DEFAULT FALSE;
				DECLARE CONTINUE HANDLER FOR NOT FOUND SET cursorFinalizado2 = TRUE;
            
				SET old_coder_id = -1;
				SET i_afebeh = 0;
            
				OPEN cursorAffectives;
				
				loop_affectives: LOOP
					
					FETCH cursorAffectives INTO var_time_on_video_session_affective, var_coder_id_affective, var_coder_name_affective, var_label_affective;
					
					IF cursorFinalizado2 THEN
						LEAVE loop_affectives;
					ELSE
						IF var_time_on_video_session_affective <> var_time_on_video_session THEN
							ITERATE loop_affectives;
						ELSE
							IF var_coder_id_affective <> old_coder_id THEN
								SET old_coder_id = var_coder_id_affective;
								SET i_afebeh = 0;
								SET @str_query = CONCAT('UPDATE RelatorioAnotacoes SET coder_', (old_coder_id - 25), ' = \'', var_coder_name_affective, '\' WHERE id = ', var_last_id);
								PREPARE stmt FROM @str_query;
								EXECUTE stmt;
							END IF;
							SET i_afebeh = i_afebeh + 1;
							
							SET @str_query = CONCAT('UPDATE RelatorioAnotacoes SET afe_', (old_coder_id - 25), '_', i_afebeh, ' = \'', var_label_affective, '\' WHERE id = ', var_last_id);
							PREPARE stmt FROM @str_query;
							EXECUTE stmt;
							
						END IF;
						
					END IF;
				
				END LOOP loop_affectives;
				
				CLOSE cursorAffectives;
            
            END affectivesBlock;
            
            behaviorsBlock: BEGIN
				
                DECLARE var_time_on_video_session_behavior TIME;
				DECLARE var_coder_id_behavior INT;
				DECLARE var_coder_name_behavior VARCHAR(45);
				DECLARE var_label_behavior VARCHAR(45);
                DECLARE cursorFinalizado3 INT DEFAULT FALSE;
				DECLARE CONTINUE HANDLER FOR NOT FOUND SET cursorFinalizado3 = TRUE;
            
				SET old_coder_id = -1;
				SET i_afebeh = 0;
            
				OPEN cursorBehaviors;
				
				loop_behaviors: LOOP
					
					FETCH cursorBehaviors INTO var_time_on_video_session_behavior, var_coder_id_behavior, var_coder_name_behavior, var_label_behavior;
					
					IF cursorFinalizado3 THEN
						LEAVE loop_behaviors;
					ELSE
						IF var_time_on_video_session_behavior <> var_time_on_video_session THEN
							ITERATE loop_behaviors;
						ELSE
							IF var_coder_id_behavior <> old_coder_id THEN
								SET old_coder_id = var_coder_id_behavior;
								SET i_afebeh = 0;
								SET @str_query = CONCAT('UPDATE RelatorioAnotacoes SET coder_', (old_coder_id - 25), ' = \'', var_coder_name_behavior, '\' WHERE id = ', var_last_id);
								PREPARE stmt FROM @str_query;
								EXECUTE stmt;
							END IF;
							SET i_afebeh = i_afebeh + 1;
							
							SET @str_query = CONCAT('UPDATE RelatorioAnotacoes SET com_', (old_coder_id - 25), '_', i_afebeh, ' = \'', var_label_behavior, '\' WHERE id = ', var_last_id);
							PREPARE stmt FROM @str_query;
							EXECUTE stmt;
							
						END IF;
						
					END IF;
				
				END LOOP loop_behaviors;
				
				CLOSE cursorBehaviors;
            
            END behaviorsBlock;
            
        END IF;
        
    END LOOP loop_clips;
    
    CLOSE cursorClips;
    
    /* RETORNA RELATORIO */
    
    SELECT maxComportamentos, maxEstadosAfetivos, maxCoders;

END ;;
